import React from 'react'
import { Button, Divider } from 'semantic-ui-react'
import ReactRotatingText from 'react-rotating-text'



export default class Welcome extends React.Component {

    render() {

        return (
            <center>
                <h1>
                    <Divider hidden/>
                    <ReactRotatingText items={["IUNNO", "IDK", "I don't know",  "Yo no sé", "知りません", "Je ne sais pas", "Ich weiß es nicht", "我不知道", "انا لا اعرف"]} />
                </h1>
                <Divider hidden/>
                <Button.Group size='large'>
                <NavLink to="/login"><Button content='Checkout' /></NavLink>                    <Button.Or />
                    <Button color='brown'>Register</Button>
                </Button.Group>
            </center>
        )
    }

}
